-- update domain variable
UPDATE [HC_DB_WEB_2].[dbo].[domain_variable] SET column_name = 'FS_2012' WHERE id = 343;
-- add new classifications for FS_2012
-- remove relationships to old classifications
DELETE FROM [HC_DB_WEB_2].[dbo].discrete_classification WHERE domainid = 343;
-- add relationhships to new classifications


 -- update collection misspelling for Southern Africa
 UPDATE [HC_DB_WEB_2].[dbo].[collection] SET label = 'Southern Africa' WHERE code = 'XXW'; 


 -- update the "Provinces within countries" schema to use ADM1_NAME_ALT instead of SubNatUnit

 -- add ADM1_NAME_ALT as an domain indicator
           ,[category_1],[category_2],[category_3],[item],[unit],[decimal_places],[year],[end_year],[extent]
           ,[classification_type],[agg_type],[agg_formula],[table_name],[column_label],[table_unique_id]
           ,[source],[micro_source],[createdby],[createddate],[published])
     VALUES
           ((SELECT MAX(id)+1 FROM [HC_DB_WEB_2].[dbo].[domain_variable]), 'ADM1_NAME_ALT', '1st administrative boundaries', 'First-level administrative boundaries', 
		   'First-level administrative boundaries', 'GAUL Level 1 region boundaries.'
           ,'Administrative','Sub-national','Country', 'boundaries', 'class', NULL, 2012, NULL, 'sub-Saharan Africa'
		   , 'class', 'NONE', NULL, 'ADM1_NAME_ALT', 'ADM1_NAME_ALT',NULL, 'HarvestChoice/IFPRI 2012', NULL, 'sparadee', CURRENT_TIMESTAMP
		   ,1);
-- update the relationship for schema "Provinces within countries" to ADM1_NAME_ALT
UPDATE [HC_DB_WEB_2].[dbo].[schema_domain] SET domainid = (SELECT id FROM [HC_DB_WEB_2].[dbo].[domain_variable] WHERE column_name = 'ADM1_NAME_ALT') WHERE schemaid = 28; 
-- add new classifications for ADM1_NAME_ALT
-- remove relationships to old classifications
DELETE FROM [HC_DB_WEB_2].[dbo].discrete_classification WHERE domainid = 329;
